package entity;

public class DPItem{
	public DPItem() {
		// TODO Auto-generated constructor stub
	}
	private String ceojuminNumber;
	private String ceoMail;
	private String ceoPhone;
	private String ceoYn;
	private String ceoName;
	public String getCeojuminNumber() {
		return ceojuminNumber;
	}
	public String getCeoMail() {
		return ceoMail;
	}
	public String getCeoPhone() {
		return ceoPhone;
	}
	public String getCeoYn() {
		return ceoYn;
	}
	public void setCeojuminNumber(String ceojuminNumber) {
		this.ceojuminNumber = ceojuminNumber;
	}
	public void setCeoMail(String ceoMail) {
		this.ceoMail = ceoMail;
	}
	public void setCeoPhone(String ceoPhone) {
		this.ceoPhone = ceoPhone;
	}
	public void setCeoYn(String ceoYn) {
		this.ceoYn = ceoYn;
	}
	public String getCeoName() {
		return ceoName;
	}
	public void setCeoName(String ceoName) {
		this.ceoName = ceoName;
	}	
}